import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { User } from 'src/app/models/User';
import { UserbackService } from 'src/app/services/userback.service';

@Component({
  selector: 'app-list-user',
  templateUrl: './list-user.component.html',
  styleUrls: ['./list-user.component.css']
})
export class ListUserComponent {
  users: User[] = [];

  constructor(private userbackService: UserbackService, private router: Router) { }

  ngOnInit(): void {
    this.userbackService.getUsers().subscribe(
      (data: User[]) => {
        this.users = data;
        console.log(data);
      },
      (error) => {
        console.error('Error fetching users:', error);
      }
    );
  }
  edit(userId: number): void {
    this.router.navigate(['admin/updateuser', userId]);
  }
  
}

<style>
h1 {
    text-align: center;
    font-size: 36px;
    font-weight: bold;
    color: #2c3e50;
    margin-bottom: 30px;
    font-family: 'Arial', sans-serif;
    text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.1);
    border-bottom: 3px solid #3498db;
    padding-bottom: 10px;
    display: inline-block;
  }
</style>
<h1>Liste des Utilisateurs</h1>
<div class="container d-flex justify-content-center align-items-center" style="min-height: 100vh;">
    <div class="row">
        <div class="col-md-12">
            <div class="table-container table-responsive">
                <table class="table table-striped text-center">
                    <thead>
                        <tr>
                         
                            <th>N° Utilisateur</th>
                            <th>Nom</th>
                            <th>Prenom</th>
                            <th>Mobile</th>
                            <th>Email</th>
                            <th>UserName</th>
                            <th>Active</th>
                            <th>Active Jusqu'à</th>

                            <th>Role</th>
                            <th>Actions</th> 
                        </tr>
                    </thead>
                    <tbody>
                        <tr *ngFor="let user of users">
                            <td>{{ user.userId }}</td>
                            <td>{{ user.nom }}</td>
                            <td>{{ user.prenom }}</td>
                            <td>{{ user.mobile }}</td>
                            <td>{{ user.email }}</td>
                            <td>{{ user.userName }}</td>
                            <td>{{ user.active }}</td>
                            <td>{{ user.activeUntil }}</td>
                            <td>{{user.roleId}}</td>
                            <td>
                                <!-- Normal action buttons -->
                                <button class="btn btn-primary btn-sm" (click)="edit(user.userId)">Edit</button>
                                <button class="btn btn-danger btn-sm ms-2" (click)="(user.userId)">Delete</button>
                              </td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>
    </div>
</div>
